import logo from './logo.svg';
import './App.css';
import mydiv1 from './mydiv1';
import MyClock from './MyClock';
import Mydiv2 from './Mydiv2';

const App =() => {

  return (
    <div className="App">
      <img src={logo} className="App-logo" alt="logo" />
      <Mydiv2></Mydiv2>
      <MyClock></MyClock>
    </div>

  );


}

export default App;
